import React from 'react';

export const QuoteDetail = props => {

    console.log(props)

   const {
        change_pct,
        close_yesterday,
        currency,
        day_change,
        day_high,
        day_low,
        eps,
        gmt_offset,
        last_trade_time,
        market_cap,
        name,
        pe,
        price,
        price_open,
        shares,
        stock_exchange_long,
        stock_exchange_short,
        symbol,
        volume,
        volume_avg,
    } = props.record;

    return (
    <div>{symbol}</div>
    );

}
